column8:
生地の縫い代の端がほつれない様にかがる用の糸です。<br>
糸が広がりますのでブラウスのふちなど、繊維をまとめるまきかがりに適しています。<br>
<br>
※大きさが工業用ミシン用で大きいです。<br>
家庭用でのご使用の場合は、ボビンに巻き直すなどしてご使用頂けます。<br>
<br>
魔法の糸として話題沸騰中！手づくりリボンが簡単につくれます。<br>
中心に4～5回巻きつけるだけで綺麗にとまります。<br>
<br>
■サイズ : 25ｇ<br>
■素材 : ナイロン100%<br>
